def find_python_files(directory):
    """  Python     """
    python_files = []
    for root, dirs, files in os.walk(directory):
        #  venv  __pycache__
        if "/venv/" in root or "\\venv\\" in root or "__pycache__" in root:
            continue
        for file in files:
            if file.endswith(".py"):
                python_files.append(os.path.join(root, file))

